import React from 'react';

function App() {
  return (
    <div className="flex flex-wrap justify-center">
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">1</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">2</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">3</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">4</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">5</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">6</div>
      <div className="bg-green-400 w-full sm:w-60 h-60 rounded-xl grid place-items-center text-4xl m-2 ">7</div>
    </div>
  );
}

export default App;
